<p>●  You may now view the recipes that have been generated, by clicking upon one you will be brought to a pane that has further information on the recipe. This    recipe can then be printed.</p>\n<p>●  By clicking the Find Local Farmers button you will be directed to the SoilMate parent site that will show you specific local farms.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1396824909,1),('field:node:113','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1192:\"<p><strong>Main Page</strong></p>\r\n\r\n<p>Upon accessing the page you will see your location and the date at the top, below that will be selections for type of produce, as well as a generate recipes button at the bottom. Produce types and items of produce man be selected, or deselected. When your desired items have been selected, you may click the “Generate Recipes” button, which will navigate you to the Recipes page and display a list of recipes.</p>\r\n\r\n<p><strong>Recipes Page </strong></p>\r\n\r\n<p>The recipes page at this time will display various recipes containing the ingredients that you’ve selected. You may click on them to further investigate them. A “Find local farmers” button also exists, directing you to the SoilMate parent site, allowing you to find specific local farms to purchase your items. These recipes are also sortable by other limiting factors, such as palate, dietary constraints, and holiday.</p>\r\n\r\n<p><strong>Contact Us </strong></p>\r\n\r\n<p>Here you may fill out forms including your name, your email address, and the message you wish to send. Fields cannot be empty, and the email address must be formatted correctly (something@website.something)</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1225:\"<p><strong>Main Page</strong></p>\n<p>Upon accessing the page you will see your location and the date at the top, below that will be selections for type of produce, as well as a generate recipes button at the bottom. Produce types and items of produce man be selected, or deselected. When your desired items have been selected, you may click the “Generate Recipes” button, which will navigate you to the Recipes page and display a list of recipes.</p>\n<p><strong>Recipes Page </strong></p>\n<p>The recipes page at this time will display various recipes containing the ingredients that you’ve selected. You may click on them to further investigate them. A “Find local farmers” button also exists, directing you to the SoilMate parent site, allowing you to find specific local farms to purchase your items. These recipes are also sortable by other limiting factors, such as palate, dietary constraints, and holiday.</p>\n<p><strong>Contact Us </strong></p>\n<p>Here you may fill out forms including your name, your email address, and the message you wish to send. Fields cannot be empty, and the email address must be formatted correctly (<a href=\"mailto:something@website.something\">something@website.something</a>)</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1396827863,1),('field:node:114','a:1:{s:9:\"field_faq\";a:1:{s:3:\"und\";a:4:{i:0;a:2:{s:5:\"value\";s:2:\"20\";s:11:\"revision_id\";s:2:\"20\";}i:1;a:2:{s:5:\"value\";s:2:\"22\";s:11:\"revision_id\";s:2:\"22\";}i:2;a:2:{s:5:\"value\";s:2:\"23\";s:11:\"revision_id\";s:2:\"23\";}i:3;a:2:{s:5:\"value\";s:2:\"24\";s:11:\"revision_id\";s:2:\"24\";}}}}',0,1396826313,1),('field:node:115','a:0:{}',0,1396838675,1),('field:node:116','a:0:{}',0,1396838683,1),('field:node:117','a:0:{}',0,1396838704,1),('field:node:118','a:0:{}',0,1396838729,1),('field:node:119','a:0:{}',0,1396838758,1),('field:node:120','a:0:{}',0,1396838847,1),('field:node:121','a:0:{}',0,1396838867,1),('field:node:122','a:0:{}',0,1396838897,1),('field:node:123','a:0:{}',0,1396838916,1),('field:node:124','a:0:{}',0,1396838937,1),('field:node:125','a:0:{}',0,1396838966,1),('field:node:126','a:0:{}',0,1396838986,1),('field:node:127','a:0:{}',0,1396839011,1),('field:node:128','a:0: