INSERT INTO `search_dataset` VALUES (1,'node',' homepage finding local produce and knowing when that produce is in season is a difficult task for the average consumer soilmate is a website that will improve accessibility to fresh produce for community members from local suppliers soilmate will also assist in finding recipes based off of the produce that is in your area  ',0),(99,'node',' cucumber image region season region  vancouver season  march may june july region  kelowna season  janurary february march region  victoria season  april may june july type  produce ',0),(100,'node',' tomato image region season region  kelowna season  april october november december type  produce ',0),(101,'node',' onion image region season region  kelowna season  april type  produce ',0),(102,'node',' lettuce image region season region  kelowna season  april type  produce ',0),(103,'node',' avocado image region season region  vancouver season  march april may june july region  kelowna season  march april may june type  produce ',0),(104,'node',' milk image region season region  kelowna season  april type  dairy ',0),(105,'node',' dill image region season region  kelowna season  april type  produce ',0),(106,'node',' celery seeds image region season region  kelowna season  april type  seeds ',0),(107,'node',' apple image region season region  kelowna season  april type  fruit ',0),(108,'node',' quinoa image region season region  kelowna season  april type  grains ',0),(109,'node',' test 1 ',0),(111,'node',' potato image region season region  kelowna season  april type  produce ',0),(112,'node',' step by step directions on the home page your region will be determined by geoip your season will be determined by the current date select the generate produce button peruse the generated list of produce select the produce you are interested in creating recipes from by leftclicking them when you are happy with your selections click the generate recipes button the returned recipes will contain all of your selections fewer selections results in more recipes on the recipes page you may now view the recipes that have been generated by clicking upon one you will be brought to a pane that has further information on the recipe this recipe can then be printed by clicking the find local farmers button you will be directed to the soilmate parent site that will show you specific local farms  ',0),(113,'node',' more detailed help main page upon accessing the page you will see your location and the date at the top below that will be selections for type of produce as well as a generate recipes button at the bottom produce types and items of produce man be selected or deselected when your desired items have been selected you may click the generate recipes button which will navigate you to the recipes page and display a list of recipes recipes page the recipes page at this time will display various recipes containing the ingredients that you ve selected you may click on them to further investigate them a find local farmers button also exists directing you to the soilmate parent site allowing you to find specific local farms to purchase your items these recipes are also sortable by other limiting factors such as palate dietary constraints and holiday contact us here you may fill out forms including your name your email address and the message you wish to send fields cannot be empty and the email address must be formatted correctly  something websitesomething   ',0),(114,'node',' faq question why do i get nothing returned when i select lots of ingredients answer all ingredients selected must be included in the recipes returned question will i know if the produce is organic answer upon selecting the find local farmers button and being navigated to the soilmate parent site you will see displayed information about the individual farmers including things such as whether they are organic and what items they harvest in what seasons question will i be able to look up produce in regions besides my own answer yes though by default it will look in your current region you can easily select another if you re curious or are traveling question will i be able to look up produce in time periods besides my current one answer yes by default produce in your current time period will be displayed you can easily select another if you are planning for the future or curious  ',0),(115,'node',' lacto vegetarian ',0),(116,'node',' ovo vegetarian ',0),(117,'node',' pescetarian ',0),(118,'node',' vegan ',0),(119,'node',' vegetarian ',0),(120,'node',' dairy free ',0),(121,'node',' egg free ',0),(122,'node',' gluten free ',0),(123,'node',' peanut free ',0),(124,'node',' seafood free ',0),(125,'node',' sesame free ',0),(126,'node',' soy free ',0),(127,'node',' sulfite free ',0),(128,'node',' tree nut free ',0),(129,'node',' wheat free ',0);
