CREATE TABLE `zipcodes` (
  `zip` varchar(16) NOT NULL DEFAULT '0' COMMENT 'Postal / ZIP code.',
  `city` varchar(30) NOT NULL DEFAULT '' COMMENT 'City.',
  `state` varchar(30) NOT NULL DEFAULT '' COMMENT 'Province / State.',
